webpackJsonp([0x8c9f1a885723],{5385:function(t,e){t.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/11/crhhoover.jpg" height="342" width="325" border="0" alt="crhhoover.jpg: " /></p>\n<p>Christopher just rolled out the vacuum cleaner, pulled out the cord, plugged it into an supposedly child-proofed socket, turned it on, and started vacuuming. </p>\n<p>Dave\'s Picks: <a href="http://davespicks.com/misc/mightbefrommn.html">You might be from Minnesota if....</a>  Despite being away for so long, I answered almost all of these correctly. Scary.</p>\n<p>There are times when a book is better than the web. I wanted to check up on Perl\'s  "|=" operator... but try search for that on <a href="http://www.google.com/search?q=PapaScott&btnG=Google+Search">Google</a>!<br />\n It doesn\'t work all that well. Turns out I really wanted ||= anyway.</p>\n<p>JÃ¶rg has written a <a href="http://dilett.antville.org/20011115/2437/">detailed review</a> (in German) of <a href="http://radio.userland.com">Radio Userland</a> at <a href="http://dilett.antville.org">dilettantville</a>. It\'s so detailed that Google cannot translate it all at one time.</p>',fields:{title:"Ohne Holland",date:"16 Nov 2001",url:"https://papascott.de/2001-11-16-ohne-holland/"}}},pathContext:{slug:"/2001-11-16-ohne-holland/",prev:{fields:{title:"Eat Your Cake",date:"15 Nov 2001",slug:"/2001-11-15-eat-your-cake/"}},next:{fields:{title:"Foggy Bottom",date:"17 Nov 2001",slug:"/2001-11-17-foggy-bottom/"}}}}}});
